import React from 'react';
import { makeStyles } from '@material-ui/core/styles';
import Footer from './page_footer.js';
import Paper from '@material-ui/core/Paper';
import Tabs from '@material-ui/core/Tabs';
import Tab from '@material-ui/core/Tab';
import img1 from './static/qiuqiu_img/qiuqiu.jpg';
import img2 from './static/qiuqiu_img/qiuqiu1.jpg';
import img3 from './static/qiuqiu_img/qiuqiu2.jpg';
import img4 from './static/qiuqiu_img/qiuqiu3.jpg';
import img5 from './static/qiuqiu_img/qiuqiu4.jpg';
import img6 from './static/qiuqiu_img/qiuqiu5.jpg';
import img7 from './static/qiuqiu_img/qiuqiu6.jpeg';





const useStyles = makeStyles(theme => ({
	base_nav: {
		marginTop: '20px',
		textAlign: 'center',
	},
	paper: {
		backgroundColor: '#D8D8D8',
	},
	img_item: {
		flexGrow: '1',
	}
}));


export default function HeadBar() {
	const classes = useStyles();
	const [value, setValue] = React.useState(0);

	const handleChange = (event, newValue) => {
		setValue(newValue);
		alert(newValue)
	};

	return (
		<div className={classes.base_nav}>
			<Paper className={classes.paper}>
				<Tabs
				value={value}
				onChange={handleChange}
				indicatorColor="primary"
				textColor="primary"
				centered
				>
					<Tab label="Top" />
					<Tab label="Skills" />
					<Tab label="Work" />
					<Tab label="Projects" />
					<Tab label="Education" />
					<Tab label="Bottom" />
				</Tabs>
			</Paper>

			<Paper elevation={0}>

				<Paper elevation={0} className={classes.img_item}>
					<img src={img1} alt='' />
					<img src={img2} alt='' />
					<img src={img3} alt='' />
					<img src={img4} alt='' />
					<img src={img5} alt='' />
					<img src={img6} alt='' />
					<img src={img7} alt='' />
					<img src={img1} alt='' />
				</Paper>							

			</Paper>

			<Footer />
		</div>
	);
}
